import axios from "axios";
const API_BASE_URL = "/api";

export const getNearestOffices = async (latitude, longitude, jwtToken) => {
  try {
    const response = await axios.get(`${API_BASE_URL}/offices?lat=${latitude}&lng=${longitude}`, {
      headers: { Authorization: `Bearer ${jwtToken}` }
    });
    return response.data;
  } catch (error) {
    console.error("Error fetching nearest offices:", error);
    return [];
  }
};
